import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import { routes } from "../routes"

function App() {




  const _renderRouters = () => {
    return routes.map((route) => <Route 
    key={route.title}
    path={route.path}
    exact={ route.exact}
    component={route.component}/>)
  }
  return (
    <div className="App">
      <Router>
        <Switch>
          { _renderRouters() }
        </Switch>
      </Router>
    </div>
  );
}

export default App;
